import React from 'react';
import '../css/GroupPage.css'

const GroupsPage = () => {
    return (
        <div className={'group-page'}>
            <div className={'group-page-container'}>
                <div className={'group-page-item'}>
                    <div>201</div>
                </div>
                <div className={'group-page-item'}>
                    202
                </div>
                <div className={'group-page-item'}>
                    203
                </div>
            </div>
        </div>
    );
};

export default GroupsPage;
